      {menuItems.map((item) => (
        <div className="Bbody">
        <div><img src={item.img} alt="food" className='foodpic'/></div>
            
            <div>
                <h2>{item.cat}</h2>
                <h5>{item.name}</h5>
                <p>{item.desc}</p>
            </div>
             
        </div>
                ))}
    </div>
  )
}

export default Menu;
